function getHTMLZipDimensionsGoogleWebDesigner(base64StringBlob) {
    return new Promise(resolve => {
        //Regexp Patterns
        var googleWebDesignWidthPattern = /data-gwd-width="(.*?)"/
        var googleWebDesignHeightPattern = /data-gwd-height="(.*?)"/
        var insideDoubleQuotesPattern = /"(.*)"/
        var regularExpressionToCaptureFileExtension = /(?:\.([^.]+))?$/;


        var newZip = new jSZip();

        var width
        var height

        newZip.loadAsync(base64StringBlob).then(function(zip) { 
            //Loop through every file in the zip archive
            for (var key in zip.files) {
                let fileExtension = regularExpressionToCaptureFileExtension.exec(key)[1]
                //Check if the file is an html file
                if (fileExtension === "html") {
                    //Open that file
                    newZip.file(zip.files[key].name).async("string").then(fileContent => getWidthAndHeight(fileContent))
                }
            }
        })
        const getWidthAndHeight = (fileContent) => {
            //Width
            var contentWidthMatch = fileContent.match(googleWebDesignWidthPattern)
            if (!contentWidthMatch) {
                return resolve([0,0])
            }
            var widthWithPixels = contentWidthMatch[1]
            if (!widthWithPixels) {
                return resolve([0,0])
            }
            var widthWithoutPixesls = contentWidthMatch[1].slice(0, widthWithPixels.length - 2);

            //Height
            var contentHeightMatch = fileContent.match(googleWebDesignHeightPattern)
            if (!contentHeightMatch) {
                return resolve([0,0])
            }
            var heightWithPixels = contentHeightMatch[1]
            if (!heightWithPixels) {
                return resolve([0,0])
            }
            var heightWithoutPixesls = contentHeightMatch[1].slice(0, heightWithPixels.length - 2); 
            return resolve([+widthWithoutPixesls,+heightWithoutPixesls])
        }
    })
   
}

function getHTMLZipDimensionsFromMetaTag(base64StringBlob) {
    return new Promise(resolve => {
    //Regexp Patterns
    var regularExpressionToCaptureFileExtension = /(?:\.([^.]+))?$/;
    var contentWidthPattern = /content="((width=)(.*,,*?),*?)/
    var contentHeightPattern = /height=(.*?)"/

    //Create a zip archive from the base64StringBlob
    var newZip = new jSZip();

    var width
    var height
    
        newZip.loadAsync(base64StringBlob).then(function(zip) {
            //Loop through every file in the zip archive
            for (var key in zip.files) {
                let fileExtension = regularExpressionToCaptureFileExtension.exec(key)[1]
                 //Check if the file is an html file
                if (fileExtension === "html") {
                    //Open that file
                   newZip.file(zip.files[key].name).async("string").then(fileContent => getWidthAndHeight(fileContent))
                }
            }
        })
        const getWidthAndHeight = fileContent => {
            var contentWidthMatch = fileContent.match(contentWidthPattern)
            if (contentWidthMatch) {
                var widthAndComma = contentWidthMatch[contentWidthMatch.length - 1]
                if (widthAndComma) {
                    var widthWithoutComma = widthAndComma.slice(0,widthAndComma.length - 1)
                    width = widthWithoutComma
                    if(width === "device-width") {
                        return resolve([0,0])
                    }
        
                    var contentHeightMatch = fileContent.match(contentHeightPattern)
                    if (contentHeightMatch) {
                        height = contentHeightMatch[contentHeightMatch.length - 1]
                        resolve([+width, +height]);
                    }
                }
              
            }
          resolve([0,0])
        }
    })
}

